import React, { useState } from 'react';
import './doctorLanding.css'; // Import the CSS file

const doctorLanding = () => {
  // Dummy data for scheduled and previous patients
  const [scheduledPatients] = useState([
    { name: 'Patient A', token: '1234', visits: 7 },
    { name: 'Patient B', token: '5678', visits: 3 },
    { name: 'Patient C', token: '9101', visits: 1 },
  ]);

  const [previousPatients] = useState([
    { name: 'Patient X', visits: 5 },
    { name: 'Patient Y', visits: 2 },
  ]);

  const [notes, setNotes] = useState('');
  const [patientStats] = useState({
    visitsToday: 3,
    visitsThisMonth: 25,
  });

  // Handle note change
  const handleNoteChange = (e) => setNotes(e.target.value);

  // Save notes
  const saveNotes = () => {
    console.log('Notes saved:', notes);
    setNotes(''); // Clear notes after saving
  };

  return (
    <div className="doctor-landing">
      {/* Header */}
      <header>
        <div className="logo">Doctor Dashboard</div>
        <nav className="dashboard-nav">
          <a href="#patients">Patients</a>
          <a href="#appointments">Appointments</a>
          <a href="#prescriptions">Prescriptions</a>
        </nav>
        <input type="search" placeholder="Search in site" />
      </header>

      {/* Doctor Info */}
      <section className="doctor-info">
        <div className="profile-pic"></div>
        <div className="doctor-details">
          <h2>Dr. John Doe</h2>
          <p>General Medicine</p>
          <p>Welcome back, Dr. Doe. Here are your scheduled patients for today.</p>
        </div>
        <div className="buttons">
          <button className="view-profile-btn">View Profile</button>
          <button className="logout-btn">Logout</button>
        </div>
      </section>

      {/* Scheduled Patients */}
      <section className="patients-section">
        <h2>Scheduled Patients</h2>
        <div className="patients-list">
          {scheduledPatients.map((patient, index) => (
            <div key={index} className="patient-card">
              <span role="img" aria-label="patient">😷</span>
              <p>{patient.name} - Token No: {patient.token}</p>
              <p>No. of Visits: {patient.visits}</p>
            </div>
          ))}
        </div>
      </section>

      {/* Previous Patients */}
      <section className="previous-patients">
        <h2>Previous Patients</h2>
        <div className="patients-list">
          {previousPatients.map((patient, index) => (
            <div key={index} className="patient-card">
              <span role="img" aria-label="patient">😷</span>
              <p>{patient.name} - No. of Visits: {patient.visits}</p>
            </div>
          ))}
        </div>
      </section>

      {/* Add Notes */}
      <section className="notes-section">
        <h2>Add Notes to Patient</h2>
        <form className="notes-form" onSubmit={(e) => e.preventDefault()}>
          <textarea
            value={notes}
            onChange={handleNoteChange}
            placeholder="Enter notes here..."
          />
          <button type="button" onClick={saveNotes}>Save Notes</button>
        </form>
      </section>

      {/* Patient Statistics */}
      <section className="stats-section">
        <h2>Patient Statistics</h2>
        <div className="stats-grid">
          <div className="stat-item">
            <h3>Visits Today</h3>
            <p>{patientStats.visitsToday}</p>
          </div>
          <div className="stat-item">
            <h3>Visits This Month</h3>
            <p>{patientStats.visitsThisMonth}</p>
          </div>
        </div>
      </section>
    </div>
  );
};

export default doctorLanding;
